CREATE DATABASE BookStore;

USE BookStore;

CREATE TABLE Books 
(
		ID INT PRIMARY KEY NOT NULL IDENTITY(1,1),
		[Name] NVARCHAR(255),
		Author NVARCHAR(255),
		Publisher NVARCHAR(255),
		[Date] DATE,
		Genre NVARCHAR(255),
		NumberOfList INT,
		Price MONEY,
		InStock NVARCHAR(4)
);


CREATE TABLE Customers 
(
		ID INT PRIMARY KEY NOT NULL IDENTITY(1,1),
		FullName NVARCHAR(255),
		Discount DECIMAL(3,1) CHECK(Discount < 100 AND Discount > 0),
		Birthdate DATE,
		Gender NVARCHAR(255),
		MobileNumber NVARCHAR(255),
		Email NVARCHAR(255),
		Profession NVARCHAR(255),
		RegisteredDate DATE
);

CREATE TABLE Orders
(
		ID INT PRIMARY KEY NOT NULL IDENTITY(1,1),
		CustomerID INT,
		BookID INT,
		[Date] DATETIME NOT NULL,
		FOREIGN KEY(CustomerID) REFERENCES Customers(ID),
		FOREIGN KEY(BookID) REFERENCES Books(ID)
);



