-- 1) Neche 45+ yashli kishi mushterilerim var
SELECT SUM(CASE WHEN DATEDIFF(YEAR, BirthDate, GETDATE()) > 45 THEN 1 ELSE 0 END) AS Bigger_Than_45 FROM Customers WHERE ID IN
(SELECT CustomerID FROM Orders)


-- 2) Hekim qadinlarin oxudugu kitab janrlari
SELECT Genre FROM Books WHERE ID IN
(SELECT BookID FROM Orders WHERE CustomerID IN
(SELECT ID FROM Customers WHERE Gender = 'Female' AND Profession LIKE('%Nurse%'))
)

-- 3) 25 yasha kimi, endirimi 5%+ ve 6 aydan artiq mushterimiz olanlarin umumi aldighi kitab mebleghi

SELECT SUM(Price) AS Book_Price FROM Books WHERE ID IN
(SELECT BookID FROM Orders WHERE CustomerID IN
(SELECT ID FROM Customers WHERE DATEDIFF(YEAR, Birthdate, GETDATE()) < 25 AND Discount > 5 AND DATEDIFF(MONTH, RegisteredDate, GETDATE()) > 6)
)

-- 4) endirimi 15% den artiq olan ve mueyyen yazichi terefinden kitablari alan mushterilerin siyahisi

SELECT * FROM Customers WHERE Discount > 15 AND ID IN
(SELECT CustomerID FROM Orders WHERE BookID IN
(SELECT ID FROM Books WHERE Author LIKE('__b%[a-g]'))
)


-- 5) Adi 'A' ile bashlayan bu il hefte sonuna ad gunu dushen 3 aydan artiq mushterimiz olan mushterilerin aldigi kitablarin neshriyyatlari

SELECT Publisher FROM Books WHERE ID IN
(SELECT BookID FROM Orders WHERE CustomerID IN
(SELECT ID FROM Customers WHERE FullName LIKE ('A%') AND DATEDIFF(MONTH, RegisteredDate, GETDATE()) > 3 AND
(DATENAME(WEEKDAY, DATEADD(YEAR, DATEDIFF(YEAR, Birthdate, GETDATE()), Birthdate)) = 'Sunday' OR 
DATENAME(WEEKDAY, DATEADD(YEAR, DATEDIFF(YEAR, Birthdate, GETDATE()), Birthdate)) = 'Saturday'))
)

-- 6) 6 ile yaxin musterimiz olan ve endirimi 2% den az olan musterilerin aldighi kitablarin toplam qiymeti
SELECT SUM(Price) AS Book_Price FROM Books WHERE ID IN
(SELECT BookID FROM Orders WHERE CustomerID IN
(SELECT ID FROM Customers WHERE Discount < 2 AND DATEDIFF(YEAR, RegisteredDate, GETDATE()) < 6)
)


-- 7) Yashi 7 den asaghi olan ve endirimi 25.5 % den asaghi olan ve drama oxuyan oghlan ushaqlarinin siyahisi
SELECT * FROM Customers WHERE Discount < 25.5 AND DATEDIFF(YEAR, Birthdate, GETDATE()) < 7 AND Gender = 'Male' AND ID IN
(SELECT CustomerID FROM Orders WHERE BookID IN
(SELECT ID FROM Books WHERE Genre LIKE('%Drama%'))
)

-- 8) Discountu 50 % den yuxari olan onunla bele 1-dene kitab almayan musterilerin siyahisi
SELECT * FROM Customers WHERE Discount > 50 AND ID NOT IN
(SELECT CustomerID FROM Orders)


-- 9) Her musterinin aldighi kitab sayi azalan sira ile
SELECT CustomerID AS [Customer ID], COUNT(BookID) AS THE_NUMBER_OF_BOOKS_BOUGHT FROM Orders GROUP BY(CustomerID) ORDER BY COUNT(BookID) DESC

-- 10) En 1-ci kitabi alan musteri
SELECT * FROM Customers WHERE ID IN
(SELECT CustomerID FROM Orders WHERE [Date] = (SELECT MIN([Date]) FROM Orders))

-- 11) En son kitabi alan musteri
SELECT * FROM Customers WHERE ID IN
(SELECT CustomerID FROM Orders WHERE [Date] = (SELECT MAX([Date]) FROM Orders))



-- 12) Yayda kitab alan musterilerin sayi
SELECT COUNT(*) AS Count_Of_Customers_Who_Bought_Book_In_Summer FROM Customers WHERE ID IN
(SELECT CustomerID FROM Orders WHERE DATENAME(MONTH, [Date]) = 'August' OR DATENAME(MONTH, [Date]) = 'June' OR DATENAME(MONTH, [Date]) = 'July')


-- 13) Yeni ilde kitab alan musteri(ler)in siyahisi
SELECT * FROM Customers WHERE ID IN 
(SELECT CustomerID FROM Orders WHERE DATENAME(DAY, [Date]) = 31 AND DATENAME(MONTH, [Date]) = 'December')

